import React from 'react';
import Auth from './Auth'
import Home from './Home'
import Protected from './Protected'
import {
    Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";




const App = ()=>{
   
    
    return(
        <Router>
        <Switch>
        <Route exact path="/home">
          <Home />
        </Route>
        <Route path="/">
          <Auth />
        </Route>
        <Route path="/dashboard">
          <Protected />
        </Route>
      </Switch>
    </Router>
    
    )
}


export default App;
